●スッキリ収納で調理の作業性アップで引き出し式システムキッチンの整理整頓に便利です。<br><br>●調理台下の深引き出し内にキッチンペーパーを収納できる専用ボックスです。<br><br>●キッチンペーパーを清潔に収納する箱型タイプで、ロールタイプのキッチンペーパーを収納できます。<br><br>●キッチンペーパーサイズ：幅22～24cmまで対応します。<br><br>●引き出しの中に収納したままラクにカットできます。<br><br>●引き出し内・シンクトップ、どちらでも使用できます。<br><br>●フタにキッチンペーパーをセットし本体に入れるだけで簡単にセットできます。<br><br>●複数のキッチンペーパーボックスをしっかり固定し、組み合わせて使えるジョイント付きです。<br><br>●他のトトノシリーズとの連結も可能です。<br><br>●引き出しのサイズや用途に合わせていろいろな組み合わせができ、モジュール収納が実現、しっかり仕切ってすっきり整頓いたします。<br><br>●プラスチック製なので、水洗いできてお手入れ簡単です。<br><br><table width="500" border="0" align="left" cellpadding="3" cellspacing="1" bgcolor="#CCCCCC" style="font-size:13px; color:#333333;"><tr bgcolor="#FFFFFF"><td width="58">サイズ</td><td>約 幅28×奥行14×高さ14（cm）</td></tr><tr bgcolor="#FFFFFF"><td width="58">材質</td><td>ポリプロピレン</td></tr><tr bgcolor="#FFFFFF"><td width="58">生産国</td><td>日本</td></tr><tr bgcolor="#FFFFFF"><td width="58">備考</td><td>本体1個<br>［付属品］ジョイント1個<br>耐熱温度：-20度～80度</td></tr></table><table width="600" border="0" cellpadding="10">
